      rvWidth = viewer.w,
      rvHeight = viewer.h;
    //ç¨æ·èªå®ä¹å°å¾çOptionsæ¶ï¼è¥æªæå®è¯¥åæ°çå¼ï¼åç³»ç»é»è®¤ä¸º6378137ç±³ï¼å³WGS84åèç³»çæ¤­çä½é¿åè½´ã
    datumAxis = datumAxis || 6378137;
